import React, { FunctionComponent } from 'react';
import { Link } from 'react-router-dom';
import { RoutePaths } from '../../routes/routePaths';

const Header: FunctionComponent = () => {
  return (
    <div className="Header" style={{ display: 'flex', justifyContent: 'space-between' }}>
      <Link style={{ width: '60%' }} to={RoutePaths.HOME}>HGR</Link>
      <nav style={{ width: '40%' }} >
        <ul style={{ display: 'flex' }}>
          <li style={{ width: 'fit-content', marginLeft: '10px' }}><Link to={RoutePaths.PROFILE}>profile</Link></li>
          <li style={{ width: 'fit-content', marginLeft: '10px' }}><Link to={RoutePaths.FAVOURITE_RECIPES}>favourite recipes</Link></li>
          <li style={{ width: 'fit-content', marginLeft: '10px' }}><Link to={RoutePaths.ALL_RECIPES}>all recipes</Link></li>
        </ul>
      </nav>
    </div>
  );
}

export default Header;
